import logo from "./logo.svg";
import "./App.css";
import AssetEntry from "./components/assetEntry";
import AssetRequest from "./components/assetRequest";

function App() {
  return (
    <div>
      <header>
        <h1>JRNL</h1>
        <h2>Asset Management </h2>
      </header>
      <body>
        <section>
          <AssetEntry />
        </section>
        <section>
          <AssetRequest />
        </section>
      </body>
    </div>
  );
}

export default App;
